css:
atom-text-editor[data-grammar="source python"] .autocomplete-suggestion-list.select-list.popover-list .suggestion-description-content,
:host .autocomplete-suggestion-list.select-list.popover-list .suggestion-description-content {
  white-space: pre-wrap;
}
autocomplete-python-suggestion {
  width: auto;
  display: inline-block;
  min-width: 200px;
  max-width: 800px;
  color: #e2e2df;
  padding: 5px 0;
  padding-left: 0.6em;
  padding-right: 0.6em;
  min-height: 2em;
  line-height: 1.3;
  background: #070b0e;
  border-radius: 0 0 3px 3px;
  max-height: 312px;
  overflow-y: scroll;
  white-space: pre-wrap;
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
}
